import React from 'react';
import '../styles/Footer.css';

const Footer = () => {
  return (
    <div className='footer-container'>
      <div className='footer'>
        <h6 className='footer-title'>Copyright SportsBook 2023</h6>
      </div>
    </div>
  );
};

export default Footer;
